window.addEventListener("scroll",function(){let e=document.querySelector("header");50<window.pageYOffset?e.classList.add("is-sticky"):e.classList.remove("is-sticky")});let headerLinks=document.querySelectorAll(".c-nav__link");const navMenu=document.querySelector(".js-nav__menu");for(var i=0;i<headerLinks.length;i++)headerLinks[i].addEventListener("click",function(){navMenu.classList.remove("is-open")});let anchor=document.querySelectorAll(".js-anchor");for(i=0;i<anchor.length;i++)anchor[i].addEventListener("click",function(e){var t=this.getAttribute("anchor-to");const n=document.getElementById(t);t=n.getBoundingClientRect().top+window.pageYOffset;window.scrollTo({top:t-150,behavior:"smooth"})});var toggle=document.querySelector(".c-nav__toggle"),close=(toggle.addEventListener("click",function(){const e=document.querySelector(".js-nav__menu");e.classList.add("is-open")}),document.querySelector(".c-nav__close"));close.addEventListener("click",function(){const e=document.querySelector(".js-nav__menu");e.classList.remove("is-open")}),window.addEventListener("scroll",function(){let e=document.querySelector(".js-scrollup");350<window.pageYOffset?e.classList.add("is-active"):e.classList.remove("is-active")});